//import React, { useState } from 'react';
import BotaoMenu from "./componentes/BotaoMenu";

function App(props) {
  //const [agendaVisivel, setAgendaVisivel] = useState('');
  //const [cadastroVisivel, setCadastroVisivel] = useState('');
  //const [avaliacaoVisivel, setAvaliacaoVisivel] = useState('');
  //const [mensalidadeVisivel, setMensalidadeVisivel] = useState('');

  function clicadoAgenda(titulo){
    console.log(titulo);
  }

  function clicadoCadastro(titulo){
    console.log(titulo);
  }

  function clicadoAvaliacao(titulo){
    console.log(titulo);
  }

  function clicadoMensalidade(titulo){
    console.log(titulo);
  }

  return (
    <div>
      <div className="centralizado">
        <p className="titulo">Clínica Integrità</p>
        <BotaoMenu clicadoAgenda={clicadoAgenda} titulo="Agenda"></BotaoMenu>
        <BotaoMenu clicadoCadastro={clicadoCadastro} titulo="Cadastro Paciente"></BotaoMenu>
        <BotaoMenu clicadoAvaliacao={clicadoAvaliacao} titulo="Avaliação Acupuntura"></BotaoMenu>
        <BotaoMenu clicadoMensalidade={clicadoMensalidade} titulo="Mensalidade"></BotaoMenu>
      </div>
    </div>
  );
}

export default App;
